import React, { useLayoutEffect, useEffect } from "react";
import { View, Text, Button } from "react-native";
import axios from "axios";
import { Con, SafeCon } from "../assets/common/common";
import { SafeAreaView } from "react-native-safe-area-context";
import Icon from "react-native-vector-icons/FontAwesome";
import styled from "styled-components/native";

const Home = ({ navigation }) => {
  useLayoutEffect(() => {}, []);

  useEffect(async () => {
    const photoShop = await axios({
      method: "get",
      url: "http://172.30.1.25:4000/getPhotoShop",
      responseType: "json",
    })
      .then(({ data }) => {
        return data;
      })
      .catch((res) => {
        console.log(res);
      });

    console.log(photoShop);
  }, []);

  const handleAxios = () => {};

  const SafeCon = styled.SafeAreaView`
    background-color: pink;
    width: 100%;
    padding: 30px;
  `;

  return (
    <SafeCon>
      <Text>Hoaazme</Text>
      <Button title="zz" onPress={handleAxios}></Button>
    </SafeCon>
  );
};

export default Home;
